> "Walk-in" access is confirmed as being the following currently: if, **after the embargo date has elapsed** a thesis/dissertation has walk-in access set to "yes," this means that users can only access the file at a dedicated desktop machine with a fixed IP, in the Mudd Reading Room.

This reads like our `readingroom` use case with IPs being set for those machines (would be great, we've had that feature for years and haven't been able to use it) - it would mean those machines would also be able to access other reading room only material. If we're okay with that, then great. We just need the IPs.

@kelynch is gonna follow up and get back to us.
